var solve = function(board) {
    test(board); 
};

function test(board) {
  let list = [];  
  for(let y = 0;y<board.length;y++){
    for(let x = 0; x<board[y].length;x++){
       let item = board[y][x];
       if(item=='X'){
         continue;
       }
       let current = {y:y,x:x,link:[],life:4};
       for(let p of list){
         if(p.y == current.y && p.x+1==current.x){
           p.life--;
           current.life--;
           p.link.push(current);
           current.link.push(p);
         }
         if(p.x == x&&p.y+1==y){
           p.life--;
           current.life--;
           p.link.push(current);
           current.link.push(p);
         }      
       }       
       checkLift(board,current);
       current.link.push(current);
       list.push(current);    
    }
  }
  let list2 = list.map(b=>b.link);
  mergeList(list2);
console.log(list2)
  for(let ll of list2){
      if(ll.filter(b=>b.life>0).length>0){
          for(let item of ll){
              item.keep = true;
          }
      }
  }
    for(let item of list){
        if(item.keep!=true){
            board[item.y][item.x]='X';
        }
    }
}
function mergeList(list){
 for(let i = 0;i<list.length-1;i++){
    let left = list[i];
    for(let i2 = i+1;i2<list.length;i2++){
        let right = list[i2];
        let add = false;
        for(let item of right) {
          if(left.indexOf(item)>=0){
            add = true;
            break;  
          }
        }
        if(!add){
          continue;
        }
        for(let item of right) {
          if(left.indexOf(item)<0){
            left.push(item);  
          }
        }
        list.splice(i2,1);
        mergeList(list);
        return;
    }
    
  }
    return;
}


function checkLift(board,item) {
  if(item.y>0&&item.y<board.length-1){
    if(board[item.y-1][item.x]=='X') {
      item.life--;
    }
    if(board[item.y+1][item.x]=='X') {
      item.life--;
    }
  }
  if(item.x>0&&item.x<board[item.y].length-1){
    if(board[item.y][item.x-1]=='X') {
      item.life--;
    }
    if(board[item.y][item.x+1]=='X') {
      item.life--;
    }
  }
}

